g to Verify Account and register a card there. After adding the card details, I come to the page \"Authenticate Card\". Here I try to upload either my ID card photo, or my passport photo, but every time I receive a message \"The Photo Id Field Is Required\". However, all the ID card and the passport has photo on it. \r\n\r\nCan you help me with this issue? How can I upload the ID document and verify my account?\r\n\r\nThanks in advance. \r\n\r\nKind regards,\r\nNarmina Aliyeva',1,'2016-10-08 05:28:59'),(55,105,'Alberto&nbsp;&nbsp;Masini','albertomasininl@gmail.com','0000-00-00','','Withdraw money','Hi, I had money on Payments Hub and I  have made a withdraw to my Italian bank account some minutes ago. I would like to know more or less in how many days I should expect to see the money in my bank account. Thank you.',1,'2016-10-09 09:17:15'),(56,100,'Jelmer Alexander&nbsp;de&nbsp;Kok','dkokja@gmail.com','0000-00-00','','Get Verified','Hello, \r\n\r\nI can not get verified. I try to upload the document I am asked for but when I click \"save\" a denied window comes up.\r\n\r\nHow can I get verified? Thanks',1,'2016-10-09 09:23:20'),(57,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Documents','I\'ve tried to upload the verification documents and alway appear the error page. How can I edit the bank account ?',1,'2016-10-09 09:29:11'),(58,105,'Alberto&nbsp;&nbsp;Masini','albertomasininl@gmail.com','0000-00-00','','Cancellation of withdraw','Hi I would like to cancel my withdraw. Please contact me soon.',1,'2016-10-09 10:35:09'),(59,102,'Ekaterina&nbsp;&nbsp;Varivoda','katevarivoda@gmail.com','0000-00-00','','bank account','Hello! I can\'t input my SWIFT bank account (AKBBBY2X) it is written that Only alphanumeric characters allowed.  My bank is in Belarus. Furthermore, could I withdraw money to my credit card?  ',1,'2016-10-09 10:48:18'),(60,0,'Ahmed Algelany','ahmedelgilany@yahoo.com','0000-00-00','','How many days or hours to get it deposite