316365\r\n\r\nThank you! Please send this message to your assigned department.',1,'2016-10-10 07:48:54'),(67,100,'Jelmer Alexander&nbsp;de&nbsp;Kok','dkokja@gmail.com','0000-00-00','','Withdraw','Hello my name is Jelmer de Kok and I would like to know how much time does a withdraw order keep \"under proccessing\"?. Also, I have linked a bank account and my account status is now verified, so, have I done everything right so that I can receive the money I have withdrawed ? Thanks.',1,'2016-10-10 08:50:57'),(68,119,'Ilaria&nbsp;&nbsp;Castelli','iaia.castelli@gmail.com','0000-00-00','','upload documents','Hello, I need to open an account but I cannot upload my documents, could you help?',1,'2016-10-10 10:30:56'),(69,117,'Patricia&nbsp;&nbsp;Vasconcellos','pcvasconcellos22@gmail.com','0000-00-00','','I want to close this account','Please, close my account. I know there are funds of $0,02 in it, but I can\'t do anything to them. I don\'t care, just close my account.',1,'2016-10-10 04:26:55'),(70,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Add a card','Hello. I\'m going to use the service, I have visa card, russian bank VTB24. It\'s multy visa, so I can keep there rubles, dollars and euro. Is it possible to ad this card? Are there going to be a fee for using it? And if it\'s possible to recieve dollar or it\'s going to exchange it into rubles automaticaly according to the rates of the bank? Thank you!',1,'2016-10-10 05:05:21'),(71,121,'Tony&nbsp;&nbsp;Bobo','tony.bobo@hotmail.fr','0000-00-00','','change nationality','Hi,\r\n\r\nI\'m French, living actually in Argentina. Creating my account I mistakenly set my nationality as Argentinian. I\'m now asked to contact you in order to make this change.\r\n\r\nWhat are the required steps to change the nationality on my account?\r\n\r\nThanks\r\n\r\nTony',1,'2016-10-10 05:11:14'),(72,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Bank Account','You sent this answer for my e-mail \"About bank withdrawal, you can withdraw money to European banks only. You need to have IBAN. After you add a bank account, you will see the last 4 digits of the IBAN in \"Bank accounts\" page. Rest digits will be masked for security reasons. Once you have added a bank account by entering IBAN, you can withdraw money to that bank account.\" Ones more the problem is that your\'s system doesn\'t record all numbers from my account. The last four digits which show your\'s system is not the last but middle one in first my bank account and when I delete the spaces between the each four numbers showed only not the last four digits but before last four digits. Maybe I don\'t understand how I should put IBAN number to space for a bank account. Please explain me? I sent you my statement and there is IBAN number of my bank account. Maybe you can put it the way should be.\r\n\r\n',1,'2016-10-10 06:39:43'),(73,109,'Gillian&nbsp;&nbsp;Bulbeck Schneiderman','gillian_bulbeck@hotmail.com','0000-00-00','','Ref verifying documents','In order to use funds which my clients pay to me via Payments Hub I plan on transferring funds over to my debit card.. I understand that in order to do this, you require a copy of my passport .. which since it is in Spanish, you need the passport to be translated.. My question is Do you need the translation to be done by a certified translator and/or verified by a lawyer .. ',1,'2016-10-10 07:55:58'),(74,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Adding a cart or account','Hello. I have a russian bank cart with the option of multy currency. As far as I understand it\'s easier to add a bank account. But what\'s the difference if I add a card and if I add an account? So, what I need is to draw money to my account so I can use them. Thank you!',1,'2016-10-11 06:56:12'),(75,119,'Ilaria&nbsp;&nbsp;Castelli','iaia.castelli@gmail.com','0000-00-00','','Verify account','Hello Dear, as requested in the email, I attach the pictures here.\r\n\r\nLet me know\r\n\r\nIlaria',1,'2016-10-11 08:55:00'),(76,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Transfer European Bank','How long takes a transfer to European Bank ?',1,'2016-10-11 10:40:19'),(77,109,'Gillian&nbsp;&nbsp;Bulbeck Schneiderman','gillian_bulbeck@hotmail.com','0000-00-00','','Follow up','Yesterday I sent you a support ticket requesting help regarding exact requirements to verify my card .. to be precise what is you need regarding translation of passport .. AS YET NO ANSWER .. This is urgent ',1,'2016-10-11 02:57:37'),(78,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Add a card','Hello!\r\n\r\nI\'d like to add a card to withdraw the money. It\'s Russian bank card, VTB24, the photos of front and back side and the photo of my pasport are attached.\r\n\r\nCould you please tell me if I can add an acoount if my bank doesn\'t use IBAN?\r\n\r\nCould you please advice when the process of veryfication will be finished and when can I withdraw the money?\r\n\r\nThank you!\r\n\r\nKind regards,\r\nMaria',1,'2016-10-12 07:07:00'),(79,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Add a card','Hello!\r\n\r\nI\'d like to add a card to withdraw the money. It\'s Russian bank card, VTB24, the photos of front and back side and the photo of my pasport are attached.\r\n\r\nCould you please tell me if I can add an acoount if my bank doesn\'t use IBAN?\r\n\r\nCould you please advice when the process of veryfication will be finished and when can I withdraw the money?\r\n\r\nThank you!\r\n\r\nKind regards,\r\nMaria',1,'2016-10-12 07:10:34'),(80,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Add a card','Hello!\r\n\r\nI\'d like to add a card to withdraw the money. It\'s Russian bank card, VTB24, I\'m trying to attache the photos of front and back side and the photo of my passport? but then something goes wrong and I can\'t submit the ticket. Is there any other