aw money using the quickest way.\r\n\r\nThank you!',1,'2016-10-14 12:00:04'),(91,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Add an account','Hello!\r\n\r\nI\'m trying to find better solution to withdraw money. I have account in Russian bank, there is no IBAN there, only swift. Is it possible to add my account?\r\n\r\nThank you!',1,'2016-10-14 12:10:42'),(92,0,'Test Name','testing@gmail.com','0000-00-00','','T tick','Subdiscount is 45 cents.',1,'2016-10-14 03:17:06'),(93,97,'Halvar&nbsp;&nbsp;Karin','halvarkarin1@yandex.com','0000-00-00','','Perls test','Original or not.',1,'2016-10-14 03:44:12'),(94,0,'Edgar Khachatryan','edgkhachatryan@mail.ru','0000-00-00','','Account verification issue','When I\'m trying to upload my national ID card photo,it shows an error.Here is the screenshot of the error.',1,'2016-10-14 09:48:33'),(95,109,'Gillian&nbsp;&nbsp;Bulbeck Schneiderman','gillian_bulbeck@hotmail.com','0000-00-00','','verificacion of card ..','I am attaching to this support ticket the documents you require to validate my card .. You will note that since my passport is from Spain, it is not only in Spanish but also in English .. hence I hope you will agree that it is not necessary to get the passport translated officially',1,'2016-10-14 11:59:48'),(96,0,'Edgar Khachatryan','edgkhachatryan50@gmail.com','0000-00-00','','visa card verification issue','Hi, I cant verify my visa card,when I\'m trying to add national ID card and visa card scans it shows an error.The format of files is .jpg.Here is the screenshot of the error.My account email is edgkhachatryan@mail.ru.I\'m adding photos of national ID card and visa card. ',1,'2016-10-15 04:16:02'),(97,109,'Gillian&nbsp;&nbsp;Bulbeck Schneiderman','gillian_bulbeck@hotmail.com','0000-00-00','','verification of documents in order to verificar card','I have already sent a support ticket which included copy of my passport together with a copy of my card .. I subsequently received a mail from client support regarding the documents which I had sent, stating the following\r\n\r\nTT SEEMS YOU SENT US THE COVER OF YOUR PASSPORT .. PLEASE SEND FRONT PAGE (FULL SIZE BOTH PAGES) OF PASSPORT WITH PHOTO... this is incorrect .. the person concerned did not scroll down because the first 5/6 pages of my passport is included \r\n..\r\n\r\nABOUT THE SCAN/PHOTO OF YOUR CARD... PLEASE SEND THE BACK OF THE CARD.. Again the person in client support who looked at this ticket, did not scroll down because both sides of the card are included ..  \r\n\r\nIn order to ensure that we are all on the same page, I am sending the same documents with this support ticket .. \r\n\r\nI trust that this time you will be able to carry through the verification of these documents ',1,'2016-10-16 03:29:03'),(98,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Transfer','My transfer is  still under processing since 11.10. How long still I have to wait for my money ? I\'ve sent you copies of my credit card and they are still not accepted.',1,'2016-10-17 11:01:27'),(99,104,'Laura&nbsp;&nbsp;Díaz ','laurama1023@gmail.com','0000-00-00','','Withdrawal of money','Dejar sirs, \r\n\r\nMy name is Laura Díaz and last Thursday I requested a withdrawal which hasn\'t been released yet.\r\n\r\nWhy does it take that long? When can I expect it to be done?\r\n\r\nThanks, \r\n\r\nLaura',1,'2016-10-17 10:25:05'),(100,118,'Martina&nbsp;&nbsp;Triaca','martinatriaca@gmail.com','0000-00-00','','verification and transaction','Hi there, I have a couple of questions:\r\n1. On Oct. 11 I made a withdrawal of US$ 200 from Payments Hub to my bank account and it still hasn\'t gone through. How long does it take for the money to be available on my bank account?\r\n2. I\'ve been trying to verify my account with pics of my ID and card, but every time I try to submit the pics I get an error page. It happened when I followed the procedure on the verification page as well as when I tried to attach the docs here with a ticket message. Is there another way I can verify my account or another way I can send the documents through? This is quite urgent. Please advise.\r\n\r\nThank you for your help,\r\nMartina Triaca',1,'2016-10-18 07:22:11'),(101,125,'Marta&nbsp;&nbsp;Casals Jové','martacasalsjo@yahoo.es','0000-00-00','','SCAM','Please be informed,\r\nThat the person who send the payment under the name of Adecco, with the email payments@jobs.adecco.com is not working for this company. This is a scam. He sends money through your platform to their “victims” so they would buy a software through Western Money and he will cancel the payments he has sent after receiving the money. Local authorities and Interpol have been informed about this Scam. So please block this client so he won’t be able to perpetrate any more scams or to cancel the payments once sent.\r\n',1,'2016-10-18 12:06:57'),(102,99,'Ahmed&nbsp;Algelany&nbsp;Abdulmageed','ahmedelgilany@yahoo.com','0000-00-00','','Delay of withdrawal of my bank transfer','Dear Sir,\r\nI\'d like to inform you that i made a withdrawal dated 09-10-2016 from Payments Hub to National Bank of Egypt, and till now i didn\'t receive the transfer although it has been made since more than one week. I don\'t know what is the reason. Please explain to me why is this delay. \r\n\r\nThanks,\r\nAhmed Algelany \r\nEmail: ahmedelgilany@yahoo.com',1,'2016-10-18 12:31:55'),(103,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Transfer','My money transfer is under processing over a week. When will the money be transferred? Your contact phone doesn\'t work ?',1,'2016-10-18 01:43:53'),(104,100,'Jelmer Alexander&nbsp;de&nbsp;Kok','dkokja@gmail.com','0000-00-00','','Withdraw','Hello,\r\n9 days ago I ordered the withdrawal. I dont have the money yet, what happened? \r\n\r\nRegards',1,'2016-10-18 06:37:39'),(105,109,'Gillian&nbsp;&nbsp;Bulbeck Schneiderman','gillian_bulbeck@hotmail.com','0000-00-00','','verification of documents in order to verificar card','Last week I wrote to Support Ticket with copy of passport and of credit card.. I received notification that I had not sent enough documentation.. However, this was an error on the part of the person who answered my query ..  Two days ago I advised that all documents originally sent are correct but as yet I have had no further communication confirming that the validation has been completed .. Please advise status ',1,'2016-10-18 08:14:16'),(106,120,'Maria&nbsp;&nbsp;Vayman','maria.vaiman@gmail.com','0000-00-00','','Adding an account and verification','Hello!\r\n\r\nI wrote several times...I need to verify an account and to ad an account. My account is of a Russian bank, we don\'t have iban number.\r\nCan you please help me to proceed? It\'s urgent and since 1 week I recieved no help!\r\nI\'ve already sent photo of my passport and bank card.\r\nPlease, respomse and tell me what to do to ad an account without iban and withdraw money.\r\nThank you...',1,'2016-10-19 10:07:58'),(107,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Transfer of the money','Last time you wrote \"Bank withdrawal can take 6 banking days. Banking days don\'t include weekends. Today is the 6th day. If the funds don\'t reach your bank today, it can\'t reach your bank within 1-2 days usually. If you don\'t see the funds in your bank account then, inform us again and we will look into this issue.\" \r\nThe money still did not arrive on my account. My account in Payments Hub was verified and I don\'t see any problem. Please explain to me when the money will be or what is the problem . Paypal transfers money to the European bank in 3 days.',1,'2016-10-20 10:28:59'),(108,114,'Uladzimir&nbsp;&nbsp;Bialou','bhhgmbh@gmail.com','0000-00-00','','Adding a bank account','Hi,\r\nI wanted to add my bank account to withdraw money. Yet, it looks like there\'s no option to to choose a bank of my choice in any country.\r\nCould you please comment on the matter',1,'2016-10-20 06:01:08'),(109,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Money transfer','The money still did not show up on my account . Please check the situation, otherwise, I\'ll take legal actions against your company.',1,'2016-10-21 06:34:37'),(110,111,'Piotr&nbsp;T&nbsp;Lugowski','silvermint999@gmail.com','0000-00-00','','Money Transfer','You send me e-mail It\'s possible that your full bank account details wasn\'t decoded completely from the IBAN you entered. And this may result in bank withdrawal delay. Bank withdrawal doesn\'t take so long usually. So you can open a new support ticket and send us the below bank details seperately for faster bank transfer processing-\r\n\r\nSWIFT code:\r\nBank account number:\r\nBranch address: (optional - if required)\r\n\r\n\r\nIf your bank has a correspondent account in United States, you can send us correspondent bank account details for faster bank transfer processing.\r\n\r\n\r\nWe can also send you transaction ID (bank confirmation number) of the bank transfer that can be used to track the bank transfer.\r\n\r\n\r\nThank you for your patience.\"\r\nThe IBAN is ES40 0081 0552 9600 0164 6768 \r\nSwift is : BSABESBB\r\nBank name is Banco de Sabadell\r\n\r\nPlease send the money as soon as possible\r\n',1,'2016-10-21 09:30:35'),(111,112,'Narmina&nbsp;&nbsp;Aliyeva','narminaaliyeva9@gmail.com','0000-00-00','','Problem with a money withdrawal','Dear All,\r\n\r\nI have registered on your website and have already received a payment from one company. It is already two weeks since I made a withdrawal to my local bank (to my bank account), but still have not received the money. \r\n\r\nMy registered email is - narminaaliyeva9@gmail.com\r\n\r\nCan you please help me and tell whom I need to contact regarding this issue? Or can you please forward this email to the one who can answer me?\r\n\r\nThanks in advance. \r\n\r\nRegards,\r\nNarmina Aliyeva',1,'2016-10-22 04:37:48'),(112,100,'Jelmer Alexander&nbsp;de&nbsp;Kok','dkokja@gmail.com','0000-00-00','','Withdraw','Hello,\r\n\r\nWhy do I not recieve the money I withdraw? two weeks already...',1,'2016-10-24 07:20:06'),(113,118,'Martina&nbsp;&nbsp;Triaca','martinatriaca@gmail.com','0000-00-00','','THIRD ATTEMPT TO CONTACT YOU','I have been trying to contact you regarding a serious issue I\'m experiencing with your service. I have been waiting for 13 days to receive the money I transferred from my Payments Hub account to my bank account and the transaction is still UNDER PROCESSING since OCTOBER 11.\r\nThis is the THIRD TIME I try to get in touch with you but it seems impossible. I have tried to call your phone number but I get a message saying it is impossible to complete the call. I don\'t know if this is a \"legal\" scam or if you just don\'t care about your users. In any event, I am using your service FOR WORK, NOT FOR FUN. This is unacceptable. ',1,'2016-10-24 09:24:17'),(114,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','Test Email Empower','Test Message Empower',1,'2016-12-16 10:48:06'),(115,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','test12345678','test teyuwtr',1,'2016-12-16 10:53:52'),(116,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','test demo','test demo',1,'2016-12-16 10:54:44'),(117,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','test test','test test',1,'2016-12-16 10:55:53'),(118,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','test test','test test',1,'2016-12-16 10:57:44'),(119,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','test demo test','test test test',1,'2016-12-16 10:59:44'),(120,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','gfddsf','dsf',1,'2016-12-16 11:01:16'),(121,72,'Thomas&nbsp;&nbsp;Campbell','samuel.gutmann2016@yandex.com','0000-00-00','','dfsdf','sdf',1